// Función para generar la leyenda
function createLegendEcorregiones() {
    var legend = L.control({ position: 'bottomright' });

    legend.onAdd = function () {
        var div = L.DomUtil.create('div', 'info legend');
        var labels = [];
        var styles = [
            { label: 'Altos Andes', color: '#FFFFCC' },
            { label: 'Puna', color: '#C0C0C0' },
            { label: 'Monte de Llanuras y Mesetas', color: '#EEDD82' },
            { label: 'Estepa Patagonica', color: '#DAA520' },
            { label: 'Monte de Sierras y Bolsones', color: '#A52A2A' },
            { label: 'Chaco Seco', color: '#D2691E' },
            { label: 'Espinal', color: '#A0522D' },
            { label: 'Pampa', color: '#F4A460' },
            { label: 'Chaco Humedo', color: '#9ACD32' },
            { label: 'Campos y Malezales', color: '#ADFF2F' },
            { label: 'Bosque Patagonicos', color: '#6B8E23' },
            { label: 'Selva Paranaense', color: '#228B22' },
            { label: 'Selva de las Yungas', color: '#006400' },
            { label: 'Esteros del Ibera', color: '#556B2F' }
        ];
        // Genera el contenido HTML de la leyenda
        styles.forEach(function (style) {
            labels.push(
                '<i style="background:' + style.color + '"></i> ' + style.label
            );
        });

        div.innerHTML = labels.join('<br>');
        return div;
    };

    // Función para mostrar/ocultar la leyenda
    function toggleLegend() {
        if (map.hasLayer(Ecoregion)) {
            legend.addTo(map);
        } else {
            legend.remove();
        }
    }
// Eliminar la leyenda al inicio
legend.remove();
    // Escucha el cambio de estado de la capa
    map.on('overlayadd overlayremove', toggleLegend);
}



